INSERT INTO `tema_dia` VALUES (286,'Magdalena del Mar sede del XIV Campeonato de Agility de las Américas y el Caribe 2014. ','<span lang=\"ES-TRAD\"><span style=\"font-family: \'Century Gothic\'; font-size: 10pt;\">Este\r\nCampeonato se llevara a cabo del 3 al 6 de Abril prximos.&nbsp; El alcalde Allison y el distrito de Magdalena\r\nuna vez mas mostraron su apoyo al Kennel Club Peruano en la realizacin de\r\neventos caninos, siendo este Campeonato de Agility el mas importante de la\r\nregin.&nbsp; Se esperan participantes de mas\r\ndel 10 pases, incluido a Estados Unidos.&nbsp;</span></span>','2013-10-29',1,1,NULL,'Agility','<span lang=\"ES-TRAD\"><span style=\"font-size: 10pt; font-family: Tahoma;\">El\r\nalcade Francis Allison se reuni con el Presidente del Kennel Club Peruano\r\nCarlos Galdos y acordaron que el Complejo Deportivo Costa Verde</span></span>',NULL,NULL,'muni.jpg',NULL,NULL,NULL),(287,'Se CONFIRMA a los jueces del XIV CAMPEONATO DE AGILITY LAS AMERICAS Y EL CARIBE 2014','<span lang=\"EN-GB\" style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 14pt; mso-bidi-font-size: 12.0pt; mso-ansi-language: EN-GB; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-fareast-language: NL; mso-bidi-language: AR-SA;\" abp=\"2541\"><span style=\"color: rgb(51, 51, 51); line-height: 115%; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; font-size: 11pt; mso-ansi-language: ES-PE; mso-fareast-font-family: Calibri; mso-fareast-language: EN-US; mso-bidi-language: AR-SA; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-bidi-theme-font: minor-bidi;\" abp=\"2542\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;Courier New&quot;; font-size: 11pt; mso-fareast-font-family: &quot;Courier New&quot;;\" abp=\"2543\"><span style=\"mso-list: Ignore;\" abp=\"2544\"><span style=\"color: rgb(0, 0, 0); font-family: Times New Roman; font-size: 12pt;\" abp=\"2545\"><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt;\" abp=\"2546\"><span lang=\"NL\" style=\"font-family: &quot;Century Gothic&quot;,&quot;sans-serif&quot;; font-size: 10pt;\" abp=\"2547\">El Kennel Club Peruano y la Comisin Organizadora del A&amp;C 2014, se complacen en confirmar la presencia de los jueces:<o:p abp=\"2548\"></o:p></span></p><span abp=\"2549\"><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt;\" abp=\"2550\"><span lang=\"NL\" style=\"color: rgb(51, 51, 51); font-family: \'Century Gothic\', sans-serif; font-size: 10pt; font-weight: bold;\" abp=\"2552\">Josef van Eester,</span><span lang=\"NL\" style=\"color: rgb(51, 51, 51); font-family: &quot;Century Gothic&quot;,&quot;sans-serif&quot;; font-size: 10pt;\" abp=\"2553\"> Blgica, Juez principal del Agility World Championship Luxemburgo 2014</span></p><span abp=\"2554\"><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt;\" abp=\"2555\"><span lang=\"NL\" style=\"color: rgb(51, 51, 51); font-family: \'Century Gothic\', sans-serif; font-size: 10pt; font-weight: bold;\" abp=\"2557\">- Tams Trj</span><span lang=\"NL\" style=\"color: rgb(51, 51, 51); font-family: &quot;Century Gothic&quot;,&quot;sans-serif&quot;; font-size: 10pt; mso-fareast-font-family: Calibri; mso-fareast-language: EN-US; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-bidi-theme-font: minor-bidi;\" abp=\"2558\">, Hungra. Juez del European Open Hungra 2014</span></p></span></span></span></span></span></span></span><p abp=\"2559\"><span lang=\"NL\" style=\"font-family: &quot;Century Gothic&quot;,&quot;sans-serif&quot;; font-size: 10pt; mso-ansi-language: NL; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-fareast-language: NL; mso-bidi-language: AR-SA; mso-bidi-font-family: &quot;Times New Roman&quot;;\" abp=\"2560\">Los esperamos y les enviamos un afectuoso saludo\r\nde&nbsp;bienvenida a nuestro Continente.</span></p>','2014-01-17',1,1,NULL,'Agility','<div abp=\"1348\">\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt;\" abp=\"1349\"><span lang=\"NL\" style=\"font-size: 10pt; font-family: Tahoma;\" abp=\"1350\">Se confirmar la presencia de los jueces:<o:p abp=\"1351\"></o:p></span></p>\r\n\r\n<span abp=\"1352\"><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt;\" abp=\"1353\"><span style=\"font-family: Tahoma;\"><span lang=\"NL\" style=\"color: rgb(51, 51, 51); font-size: 10pt; font-weight: bold;\" abp=\"1355\">Josef\r\nvan Eester</span><span lang=\"NL\" style=\"color: rgb(51, 51, 51); font-size: 10pt;\" abp=\"1356\">, de Blgica y&nbsp;</span></span><span lang=\"NL\" abp=\"1360\" style=\"font-family: Tahoma; color: rgb(51, 51, 51); font-size: 10pt; font-weight: bold;\">Tams\r\nTrj</span><span lang=\"NL\" abp=\"1361\" style=\"font-family: Tahoma; color: rgb(51, 51, 51); font-size: 10pt;\">, de Hungra.</span></p></span></div>',NULL,NULL,'Jozef Van eester y Tamas Traj.png',NULL,NULL,NULL),(288,'Director de la Competencia del XIV Campeonato de Las Américas y El Caribe 2014','<p>Es un enorme placer y orgullo confirmar la presencia del Sr. Artur Pires como Director de la Competencia de AGILITY A&amp;C 2014, sin duda su presencia nos otorga la mayor confianza y seguridad para el desarrollo de una excelente competencia.</p><p><span abp=\"14605\" data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.0.$end:0:$4:0\">Es con gran orgullo que he recibido y aceptado la invitacin a ser el Director de la Competencia de Las Amricas y El Caribe Per 2014.</span><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$1:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$3:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$4:0\">S lo mucho que la Comunidad Agilitera de Per dese este evento y sent toda esa emocin durante el fin de semana que tuve el placer de estar all para juzgar sus pruebas, as que acept el reto.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$5:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$7:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$8:0\">En los ltimos aos han cambiado muchas cosas en el Agility Peruano, del cual soy testigo; ahora es la oportunidad del gran cambio, de la unin para organizar un gran campeonato y recibir a nuestros Agilitistas amigos de otros pases en nuestra casa, y hacerlos sentir tan bien como si estuvieran en la suya.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$9:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$11:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$12:0\">Tenemos dos grandes jueces mundiales, que seguramente nos van a deslumbrar con grandes pistas y juzgamientos, tenemos el local de la competencia, ahora el resto nos queda a todos nosotros por hacer.; menciono a todos porque contamos con su apoyo y disponibilidad a partir de ahora hasta el final del evento.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$13:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$14:0\">Somos una sola comunidad de Agility Peruano y esta ser la bandera que todos tenemos que llevar con orgullo.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$15:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$17:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$18:0\">Para los competidores de otros pases, les digo que estamos comprometidos en hacer una buena competencia, y para ello contamos con todos ustedes y sus compaeros inseparables, las estrellas del Campeonato, sus perros.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$19:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$21:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$22:0\">Per est haciendo todos los esfuerzos para que sea una de las mejores competencias de Amricas y El Caribe, ser un gran evento con los mejores competidores y canes de Amrica, nadie puede faltar.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$23:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$25:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$26:0\">Bienvenidos a todos los que estarn all para entregarles lo mejor que me sea posible.</span><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$27:0\"><br data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$29:0\"><span data-reactid=\".3x.1:3:1:$comment417661265035125_1097906:0.0.$right.0.$left.0.0.0:3.0.3.0.$end:0:$30:0\">Un da tuve un sueo que estbamos organizando un Amricas y El Caribe con ms competidores que un campeonato del mundo, era un reconocimiento de que el Agility de las Amricas haba llegado a la cima. Espero que cada uno de estos campeonatos pueda servir para que mi sueo algn da 